import Layout from '../components/GeneralLayout';
import Navigation from '../components/Navigation'
import fetch from 'isomorphic-unfetch';

const Post = props => (
    <div>
        <Navigation />
        <Layout>
            <h1>{props.tile}</h1>
            <ul>
              {props.shows.map(show => (
                <li key={show.id}>
                  <Link href="/p/[id]" as={`/p/${show.id}`}>
                    <a>{show.name}</a>
                  </Link>
                </li>
              ))}
            </ul>
        </Layout>
    </div>
);

export default Post;
